  \"Gridded in situ, meteorological, navigational, physical and profile data collected
  by US DOC; NOAA; OAR; Pacific Marine Environmental Laboratory at OceanSITES site
  KEO from 2004-06-16 to 2015-08-06 (NCEI Accession 0130542)\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 2,\n\t\t\"recent\": 2\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-02-26T22:17:25.345574\",\n\t\"name\": \"gridded-in-situ-meteorological-navigational-physical-and-profile-data-collected-by-us-doc--4c3af\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In situ, meteorological, navigational,
  physical and profile oceanographic data were collected, including AIR TEMPERATURE,
  BAROMETRIC PRESSURE, CURRENT DIRECTION, CURRENT SPEED, CURRENT SPEED - EAST/WEST
  COMPONENT (U), CURRENT SPEED - NORTH/SOUTH COMPONENT (V), DEPTH - OBSERVATION, HYDROSTATIC
  PRESSURE, INCOMING SOLAR RADIATION, LATITUDE, LONGITUDE, PRECIPITATION RATE, RELATIVE
  HUMIDITY, SALINITY, SIGMA-THETA, WATER TEMPERATURE, WIND DIRECTION and WIND SPEED
  from Moored Buoy at the NOAA Kuroshio Extension Observatory (KEO) using ADCP, CTD
  - moored CTD, anemometer, barometers, meteorological sensors, pyranometer and thermistor
  from 2004-06-16 to 2015-08-06. These data were provided to one of the OceanSITES
  Data Assembly Centers (DAC). The DAC formatted this information into the OceanSITES
  file format and passed it on to the Global Data Assembly Centers (GDAC).OceanSITES
  is a worldwide system of long-term, open-ocean reference stations measuring dozens
  of variables and monitoring the full depth of the ocean from air-sea interactions
  down to the seafloor. It is a network of stations or observatories measuring many
  aspects of the ocean's surface and water column using, where possible, automated
  systems with advanced sensors and telecommunications systems, yielding high time
  resolution, often in real-time, while building a long record.\",\n\t\"license_title\":
